    return (
      <Fragment>
        <div className="container"> {/* Add className */}
          <h1 className="font-weight-light display text-center">Welcome To PeyajRoshun</h1>
          <Link to="/signup">
            <button>Sign Up</button>
          </Link>
          <Link to="/login">
            <button>User Login</button>
          </Link>
        </div>
      </Fragment>
    );
  };

  export default PeyajRoshun;
